import React from 'react';
import ReactECharts from 'echarts-for-react';
import { colors } from '@material-ui/core';
export default function MapEcharts (props) {
  var stateName =[];
  var remainingDays =[];
  //Data Initialization
  for(let i = 0;i<props.stateInfo.length;i++){
      console.log(i);
      stateName.push(props.stateInfo[i].name);
      remainingDays.push(props.stateInfo[i].hdays);
  }
  const option = {
    title: {
      text: 'Remaining Days For Each State Reach Herd Immunity',
      textStyle:{
        fontSize: 20,
        fontWeight :'bold'
      }
    },
    tooltip: {},
    legend: {
      data:['Days']
    },
    xAxis: {
      data: stateName
    },
    yAxis: {},
    series: [{
      name: 'Days',
      type: 'bar',
      data: remainingDays
    }]
  };
    return <ReactECharts option={option} style={{ height: 400 }} opts={{ renderer: 'svg' }}
  />;
};
